import './Expenses.css';

export function Expenses({props}) {
  return (
    <div>
      <h2>Let's get started!</h2>
      <ul>
      {props.map((expense) => {
        return (
          <li key={expense.id}>
            <div>{expense.date.toISOString()}</div>
            <div>{expense.title}</div>
            <div>{expense.amount}</div>
          </li>
        );
        })}
      </ul>

    </div>
  );
}
